description:
The Football League Show 02.11.2013

Duration: 1 hour, 15 min

Manish Bhasin presents the best of the action from all three divisions of the Football League. After a season of struggle, Sheffield Wednesday are again finding life hard going at the wrong end of the Championship table; this week the Owls welcome Reading to Hillsborough. Plus extended highlights as promotion chasers Watford go head-to-head with Leicester at Vicarage Road.
